import React from 'react'

export default function OldComments() {

    let getKeys = ()=>{
        for (let i=0; i<localStorage.length; i++){
            let myKey = localStorage.key(i);
            console.log(localStorage.getItem(myKey).body)
            //console.log(localStorage.getItem('ac8760a110c384'))
        }
    }
    return (
        <>
            <button onClick={getKeys}>Keys</button>
        </>
    )
}
